import React, { useState, useEffect } from 'react'
import { Row, Form, Col, Button, Alert } from 'react-bootstrap'
import Axios from 'axios'
import '../App.css';
import { Link } from 'react-router-dom';
//import Axios from 'axios'

export default class CreatePost extends Component {

    constructor(props) {
        super(props);

        this.onFileChange = this.onFileChange.bind(this);
        this.onSubmit = this.onSubmit.bind(this);

        this.state = {
            profileImg: ''
        }
    }

    onFileChange(e) {
        this.setState({ profileImg: e.target.files[0] })
    }

    onSubmit(e) {
        e.preventDefault()
        const formData = new FormData()
        formData.append('profileImg', this.state.profileImg)
        axios.post("http://localhost:5000/api/user-profile", formData, {
        }).then(res => {
            console.log(res)
        })
    }


    render() {
        return (
            <div className="container">
                <div className="row">
                    <form onSubmit={this.onSubmit}>
                        <div className="form-group">
                            <input type="file" onChange={this.onFileChange} />
                        </div>
                        <div className="form-group">
                            <button className="btn btn-primary" type="submit">Upload</button>
                        </div>
                    </form>
                </div>
            </div>
        )
    }
}


<div>
<Form >
    <Row className="justify-content-center mt-5">
        <Col md={{ span: 6, offset: 3 }}>
            <Form.Row>
                <Col className="form-group required " md={6}>
                    <Form.Label className="control-label">Title</Form.Label>
                    <Form.Control placeholder="Title" name="title" onChange={(e) => onChangeInput(e)}  />
                </Col>
            </Form.Row>
            {/* <Form.Row><br /></Form.Row> */}
            <Form.Row>
                <Col className="form-group required " md={6}>
                    <Form.Label className="control-label">Poster</Form.Label>
                    <Form.Control placeholder="Poster" name="poster" onChange={(e) => onChangeInput(e)} />
                </Col>

            </Form.Row>
            {/* <Form.Row><br /></Form.Row> */}
            <Form.Row>
                <Col className="form-group required " md={6}>
                    <Form.Label className="control-label">Image</Form.Label>
                    <Form.Control type="file" placeholder="image" name="image" onChange={(e) => onChangeInput(e)} />
                </Col>

            </Form.Row>
            {/* <Form.Row> <br /></Form.Row> */}
            <Form.Row>
                <Form.Group as={Col} className="form-group required " md={6} >
                    <Form.Label className="control-label">Overview</Form.Label>
                    <Form.Control placeholder="Overview" name="overview" onChange={(e) => onChangeInput(e)} />
                </Form.Group>
            </Form.Row>
            <Form.Row>
                <Form.Group as={Col} className="form-group required " md={6} >
                <Form.Label className="control-label">Content</Form.Label>
                <textarea className="form-control" rows="5" placeholder="Content" name="content" 
                onChange={(e) => onChangeInput(e)}></textarea>

                </Form.Group>
            </Form.Row>
            <Col md={{ span: 8, offset: 2 }}>
                <Button as={Link} to="/Timeline" variant="btn btn-outline-dark" md={6} onClick={(e) => onSubmit(e)}>
                    Post
        </Button>
            </Col>
        </Col>
    </Row>
</Form>
</div>
